import React from "react";
import { bool } from "prop-types";
import { StyledMenu } from "./Menu.styled";
const Menu = ({ open }) => {
  return (
    <StyledMenu open={open}>
      <ul>
        <li data-text="">
          <a href="/">Home</a>
        </li>
        <li>
          <a href="/">About Me</a>
        </li>
        <li>
          <a href="/">Skills</a>
        </li>
        <li>
          <a href="/">Projects</a>
        </li>
        <li>
          <a href="/">Experience</a>
        </li>
        <li>
          <a href="/">Contact</a>
        </li>
      </ul>
      {/* <a href="/">About Me</a>
      <a href="/">Skills</a>
      <a href="/">Projects</a>
      <a href="/">Experience</a>
      <a href="/">Contact</a> */}
    </StyledMenu>
  );
};
Menu.propTypes = {
  open: bool.isRequired,
};
export default Menu;
